import React from 'react'
import { NavLink } from 'react-router-dom'

export default function Dropdown({ dropdownListItems }) {
    return (
        <select className="form-select-lg" aria-label="Default select example">
            <option selected>Types</option>
            {
                dropdownListItems.map((listItem, index) => {
                    return (

                        <option key={index} value={listItem.label}>{listItem.label}</option>
                    )
                })
            }
        </select>
    )
}
